package scalc

import (
	"reflect"
	"testing"
)

func Test_union(t *testing.T) {

	tests := []struct {
		name string
		sets [][]int
		want []int
	}{
		{
			name: "nil sets",
			sets: nil,
			want: []int{},
		}, {
			name: "empty sets",
			sets: [][]int{},
			want: []int{},
		}, {
			name: "one set",
			sets: [][]int{{1, 2, 3}},
			want: []int{1, 2, 3},
		}, {
			name: "equal sets",
			sets: [][]int{{1, 2, 3}, {1, 2, 3}},
			want: []int{1, 2, 3},
		}, {
			name: "two equal sets",
			sets: [][]int{{1, 2, 3}, {4, 5, 6}, {4, 5, 6}},
			want: []int{1, 2, 3, 4, 5, 6},
		}, {
			name: "intersected ranges",
			sets: [][]int{{1, 2, 3, 5}, {4, 6, 8}, {7, 8, 9}},
			want: []int{1, 2, 3, 4, 5, 6, 7, 8, 9},
		}, {
			name: "reordered sets",
			sets: [][]int{{4, 5, 6}, {1, 2, 3}},
			want: []int{1, 2, 3, 4, 5, 6},
		}, {
			name: "intersected ranges 2",
			sets: [][]int{{1, 2, 4, 5}, {3, 4}, {1, 4}},
			want: []int{1, 2, 3, 4, 5},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := union(tt.sets...); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("Union() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_intersection(t *testing.T) {
	tests := []struct {
		name string
		sets [][]int
		want []int
	}{
		{
			name: "nil sets",
			sets: nil,
			want: []int{},
		}, {
			name: "empty sets",
			sets: [][]int{},
			want: []int{},
		}, {
			name: "one set",
			sets: [][]int{{1, 2, 3}},
			want: []int{1, 2, 3},
		}, {
			name: "equal sets",
			sets: [][]int{{1, 2, 3}, {1, 2, 3}},
			want: []int{1, 2, 3},
		}, {
			name: "no intersection sets",
			sets: [][]int{{1, 2, 3}, {4, 5, 6}, {4, 5, 6}},
			want: nil,
		}, {
			name: "intersection of 3",
			sets: [][]int{{1, 2, 3}, {3, 4, 5}, {3, 5, 7}, {3, 7, 9}},
			want: []int{3},
		}, {
			name: "three different sets",
			sets: [][]int{{1, 2, 3, 5}, {2, 3, 5}, {3, 5, 6}},
			want: []int{3, 5},
		}, {
			name: "reordered sets",
			sets: [][]int{{4, 5, 6}, {1, 2, 3, 4}},
			want: []int{4},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := intersection(tt.sets...); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("Intersection() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_difference(t *testing.T) {
	tests := []struct {
		name string
		sets [][]int
		want []int
	}{
		{
			name: "nil sets",
			sets: nil,
			want: nil,
		}, {
			name: "empty sets",
			sets: [][]int{},
			want: nil,
		}, {
			name: "one set",
			sets: [][]int{{1, 2, 3}},
			want: []int{1, 2, 3},
		}, {
			name: "different sets",
			sets: [][]int{{1, 2, 3}, {4, 5, 6}},
			want: []int{1, 2, 3, 4, 5, 6},
		}, {
			name: "equal sets",
			sets: [][]int{{1, 2, 3}, {1, 2, 3}},
			want: []int{},
		}, {
			name: "three equal sets",
			sets: [][]int{{1, 2, 3}, {1, 2, 3}, {1, 2, 3}},
			want: []int{},
		}, {
			name: "three different sets",
			sets: [][]int{{1, 2, 3}, {2, 3, 5}, {3, 5, 6}},
			want: []int{1, 2, 5, 6},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := difference(tt.sets...); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("Difference() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_normalize(t *testing.T) {

	tests := []struct {
		name string
		a    []int
		want []int
	}{
		{
			name: "nil set",
			a:    nil,
			want: nil,
		}, {
			name: "empty set",
			a:    []int{},
			want: []int{},
		}, {
			name: "duplication",
			a:    []int{1, 1, 2, 2, 3, 3},
			want: []int{1, 2, 3},
		}, {
			name: "triplication",
			a:    []int{1, 1, 1, 2, 2, 2, 3, 3, 3},
			want: []int{1, 2, 3},
		}, {
			name: "normalized set",
			a:    []int{1, 2, 3},
			want: []int{1, 2, 3},
		}, {
			name: "non sorted set",
			a:    []int{1, 2, 3, 1, 2, 3},
			want: []int{1, 2, 3},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := normalize(tt.a); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("normalize() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_diff(t *testing.T) {
	type args struct {
		a []int
		b []int
	}
	tests := []struct {
		name string
		args args
		want []int
	}{
		{
			name: "nil sets",
			args: args{
				a: nil,
				b: nil,
			},
			want: nil,
		}, {
			name: "empty sets",
			args: args{
				a: []int{},
				b: []int{},
			},
			want: []int{},
		}, {
			name: "one empty set",
			args: args{
				a: []int{1, 2, 3},
				b: []int{},
			},
			want: []int{1, 2, 3},
		}, {
			name: "different sets",
			args: args{
				a: []int{1, 2, 3},
				b: []int{4, 5, 6},
			},
			want: []int{1, 2, 3, 4, 5, 6},
		}, {
			name: "equal sets",
			args: args{
				a: []int{1, 2, 3},
				b: []int{1, 2, 3},
			},
			want: []int{},
		}, {
			name: "intersected sets",
			args: args{
				a: []int{1, 2, 3, 4},
				b: []int{4, 5, 6},
			},
			want: []int{1, 2, 3, 5, 6},
		}, {
			name: "intersected ranges",
			args: args{
				a: []int{1, 2, 3, 5},
				b: []int{4, 6, 7},
			},
			want: []int{1, 2, 3, 4, 5, 6, 7},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := diff(tt.args.a, tt.args.b); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("difference() = %v, want %v", got, tt.want)
			}
		})
	}
}

